import React from 'react';
import ReactDOM from 'react-dom';
import Comment from './comment_main';
import Join from './join_form';

ReactDOM.render(
    <Comment />,
    document.querySelector('#comment')
);
ReactDOM.render(
    <Join />,
    document.querySelector('#join')
);
